package com.jrwp.core.utils;

import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;
import java.util.UUID;

import sun.misc.BASE64Decoder;
import sun.misc.BASE64Encoder;

public class Base64ToImage {
	private static final String url = System.getProperty("user.dir")
			+ "/photos/";

	public static void main(String[] args) {
		String strImg = GetImageStr();
		System.out.println(strImg);
		GenerateImage(
				url,
				"");
	}

	// base64
	public static String GetImageStr() {// Base64
		String imgFile = "d://test.jpg";// 
		InputStream in = null;
		byte[] data = null;
		// 
		try {
			in = new FileInputStream(imgFile);
			data = new byte[in.available()];
			in.read(data);
			in.close();
		} catch (IOException e) {
			e.printStackTrace();
		}
		// Base64
		BASE64Encoder encoder = new BASE64Encoder();
		return encoder.encode(data);// Base64
	}

	// base64
	public static String GenerateImage(String url, String imgStr) { // Base64
		if (imgStr == null) // 
			return null;
		BASE64Decoder decoder = new BASE64Decoder();
		try {
			// Base64
			byte[] b = decoder.decodeBuffer(imgStr);
			for (int i = 0; i < b.length; ++i) {
				if (b[i] < 0) {// 
					b[i] += 256;
				}
			}
			// jpeg
			UUID uuid = UUID.randomUUID();
			String img = uuid.toString().replace("-", "") + ".jpg";
			String imgFilePath = url.replace("\\", "/") + img;// 
			LogUtil.debug(":{}", imgFilePath);
			OutputStream out = new FileOutputStream(imgFilePath);
			out.write(b);
			out.flush();
			out.close();
			return img;
		} catch (Exception e) {
			e.printStackTrace();
			return null;
		}
	}
}